import { Link } from 'react-router-dom'
import { useForm } from 'react-hook-form'

const Contact = () => {

  const { register, handleSubmit, watch, errors } = useForm();
  const onSubmit = data => console.log(data.name);

  return (
    <div className='contact'>
      <button className='back'><Link to="/">back</Link></button>
      <h1 className='contactme' >Contact</h1>
      <form onSubmit={handleSubmit(onSubmit)} >
        {errors.user_name && errors.user_name.type === "required" && (
          <div role="alert">Name is required<br/></div>
        )}
          <input type='text' name='user_name' placeholder='Name' maxLength='30' aria-inavlid={errors.user_name ? "true" : false} ref={register({ required: true})} />
          <br/>
          <input type='email'  name='email' placeholder='Email' maxLength='30' aria-inavlid={errors.email ? "true" : false} ref={register({ required: true})}/>
          <textarea name='message' placeholder='Message' maxLength='1500' aria-inavlid={errors.message ? "true" : false} ref={register({ required: true})}/>
          <input type='submit' value='Send' />
      </form>
    </div>
  )
}

export default Contact
